<!DOCTYPE html>
<html lang="en">
  <head>
    <meta charset="UTF-8" />
    <meta name="viewport" content="width=device-width, initial-scale=1.0" />
    <title>WinLine</title>
    <!-- <link rel="stylesheet" href="css/index.css"> -->
    <style>
      @font-face {
        font-family: PF Din Text Comp Pro;
        src: url('fonts/font.ttf');
      }

      .finger:hover {
        cursor: pointer;
      }

      #sound_player {
        width: 0px;
        height: 0px;
      }

      article,
      aside,
      details,
      figcaption,
      figure,
      footer,
      header,
      hgroup,
      menu,
      nav,
      section {
        display: block;
      }

      html,
      body,
      div,
      span,
      applet,
      object,
      iframe,
      h1,
      h2,
      h3,
      h4,
      h5,
      h6,
      p,
      blockquote,
      pre,
      a,
      abbr,
      acronym,
      address,
      big,
      cite,
      code,
      del,
      dfn,
      em,
      img,
      ins,
      kbd,
      q,
      s,
      samp,
      small,
      strike,
      strong,
      sub,
      sup,
      tt,
      var,
      b,
      u,
      i,
      center,
      dl,
      dt,
      dd,
      ol,
      ul,
      li,
      fieldset,
      form,
      label,
      legend,
      table,
      caption,
      tbody,
      tfoot,
      thead,
      tr,
      th,
      td,
      article,
      aside,
      canvas,
      details,
      embed,
      figure,
      figcaption,
      footer,
      header,
      hgroup,
      menu,
      nav,
      output,
      ruby,
      section,
      summary,
      time,
      mark,
      audio,
      video,
      button {
        margin: 0;
        padding: 0;
        border: 0;
        font-size: 100%;
        font: inherit;
        vertical-align: baseline;
        box-sizing: border-box;
        color: #fff;
        transition: 0.3s;
        font-family: PF Din Text Comp Pro;
      }

      img,
      svg {
        transition: 0.3s;
      }

      a:hover,
      button:hover {
        cursor: pointer;
        opacity: 0.6;
      }

      .free_image {
        width: 0px;
        height: 0px;
        position: relative;
      }

      .dnone {
        display: none;
      }

      a {
        text-decoration: none;
      }

      @media (min-aspect-ratio: 1/1) {
        .fone_wrapper {
          width: 0%;
          height: 100vh;
        }
      }

      @media (max-aspect-ratio: 1/1) {
        .fone_wrapper {
          width: 100%;
          height: 0px;
        }
      }

      .fone {
        display: flex;
        justify-content: center;
        align-items: center;
      }

      @media (min-aspect-ratio: 1/1) {
        .fone {
          height: 90vh;
          width: 90vh;
          max-width: 50vw;
        }
      }

      @media (max-aspect-ratio: 1/1) {
        .fone {
          width: 90vw;
          height: 90vw;
          max-height: 50vh;
        }
      }

      .fone .chip1 {
        z-index: -1;
        top: 16vh;
        left: -45vw;
        animation: top_bot_anim 9s ease-in-out infinite alternate;
      }

      @media (min-aspect-ratio: 1/1) {
        .fone .chip1 {
          top: 26vh;
          left: -25vw;
        }
      }

      .fone .chip1 img,
      .fone .chip1 svg {
        width: 20vw;
        height: 20vh;
        max-height: 20vh;
        max-width: 20vw;
      }

      .fone .chip2 {
        z-index: -1;
        top: -30vh;
        left: -45vw;
        animation: bot_top_anim 12s ease-in-out infinite alternate;
      }

      @media (min-aspect-ratio: 1/1) {
        .fone .chip2 {
          top: -36vh;
          left: -22vw;
        }
      }

      .fone .chip2 img,
      .fone .chip2 svg {
        width: 16vw;
        height: 16vh;
        max-height: 16vh;
        max-width: 16vw;
        transform: rotate(-40deg);
      }

      .fone .chip3 {
        z-index: -1;
        top: -27vh;
        left: 30vw;
        animation: bot_top_anim 15s ease-in-out infinite alternate;
      }

      @media (min-aspect-ratio: 1/1) {
        .fone .chip3 {
          top: -36vh;
          left: 12vw;
        }
      }

      .fone .chip3 img,
      .fone .chip3 svg {
        width: 14vw;
        height: 14vh;
        max-height: 14vh;
        max-width: 14vw;
        transform: rotate(180deg);
      }

      .fone .chip4 {
        z-index: -1;
        top: 15vh;
        left: 30vw;
        animation: bot_top_anim 8s ease-in-out infinite alternate;
      }

      @media (min-aspect-ratio: 1/1) {
        .fone .chip4 {
          top: 24vh;
          left: 12vw;
        }
      }

      .fone .chip4 img,
      .fone .chip4 svg {
        width: 18vw;
        height: 18vh;
        max-height: 18vh;
        max-width: 18vw;
        transform: rotate(270deg);
      }

      .fone .chip5k {
        z-index: -1;
        top: -15vh;
        left: -44vw;
        animation: bot_top_anim 8s ease-in-out infinite alternate;
      }

      @media (min-aspect-ratio: 1/1) {
        .fone .chip5k {
          top: -15vh;
          left: -30vw;
        }
      }

      .fone .chip5k img,
      .fone .chip5k svg {
        width: 16vw;
        height: 16vh;
        max-height: 16vh;
        max-width: 16vw;
      }

      .fone .chip2k {
        z-index: -1;
        top: 16vh;
        left: 12vw;
        animation: top_bot_anim 11s ease-in-out infinite alternate;
      }

      @media (min-aspect-ratio: 1/1) {
        .fone .chip2k {
          top: 32vh;
          left: -2vw;
        }
      }

      .fone .chip2k img,
      .fone .chip2k svg {
        width: 18vw;
        height: 18vh;
        max-height: 18vh;
        max-width: 18vw;
      }

      .fone .chip10k {
        z-index: -1;
        top: -10vh;
        left: 30vw;
        animation: top_bot_anim 14s ease-in-out infinite alternate;
      }

      @media (min-aspect-ratio: 1/1) {
        .fone .chip10k {
          top: -20vh;
          left: 18vw;
        }
      }

      .fone .chip10k img,
      .fone .chip10k svg {
        width: 22vw;
        height: 22vh;
        max-height: 22vh;
        max-width: 22vw;
      }

      .fone .foneTop {
        z-index: -1;
        top: -55vh;
        left: -226px;
      }

      @media (min-aspect-ratio: 1/1) {
        .fone .foneTop {
          display: none;
        }
      }

      .fone .foneBot {
        z-index: -1;
        top: 35vh;
        left: -226px;
      }

      .fone .foneBot img,
      .fone .foneBot svg {
        transform: rotate(180deg);
      }

      @media (min-aspect-ratio: 1/1) {
        .fone .foneBot {
          display: none;
        }
      }

      .fone .finger {
        z-index: 2;
        top: 2vh;
        left: 11vw;
      }

      .fone .finger img,
      .fone .finger svg {
        width: 22vw;
        height: 22vh;
        max-height: 22vh;
        max-width: 22vw;
        transform-origin: bottom;
        animation: finger_anim 1s ease-in-out infinite alternate;
      }

      @keyframes finger_anim {
        30% {
          transform: rotate(0deg) scale(1);
        }

        90% {
          transform: rotate(-20deg) scale(1);
        }

        100% {
          transform: rotate(-20deg) scale(0.8) translateY(-5vh);
        }
      }

      @keyframes top_bot_anim {
        0% {
          transform: translateY(-4vh);
        }

        100% {
          transform: translateY(6vh);
        }
      }

      @keyframes bot_top_anim {
        0% {
          transform: translateY(4vh);
        }

        100% {
          transform: translateY(-6vh);
        }
      }

      .container {
        overflow: hidden;
        width: 100%;
        margin: 0 auto;
        height: 100vh;
        display: flex;
        align-items: center;
        flex-wrap: wrap;
        align-content: center;
        row-gap: 2vh;
        justify-content: center;
        padding: 5vh 5vw;
      }

      @media (min-aspect-ratio: 1/1) {
        .container {
          flex-wrap: nowrap;
          column-gap: 3vw;
        }
      }

      .buttons {
        margin-top: 2vh;
        width: 100%;
        display: flex;
        justify-content: space-between;
        column-gap: 2vw;
      }

      @media (max-aspect-ratio: 1/1) {
        .buttons {
          order: 3;
        }
      }

      .buttons img,
      .buttons svg {
        width: 40vw;
      }

      @media (min-aspect-ratio: 1/1) {
        .buttons img,
        .buttons svg {
          width: 20vw;
        }
      }

      body {
        background: linear-gradient(
          180deg,
          #0f147d 0%,
          #000058 50%,
          #0c1178 100%
        );
        min-height: 100vh;
      }

      .header {
        text-align: center;
        font-weight: 700;
        text-transform: uppercase;
      }

      @media (min-aspect-ratio: 1/1) {
        .header img,
        .header svg {
          height: 17vh;
          max-width: 50vh;
        }
      }

      @media (max-aspect-ratio: 1/1) {
        .header img,
        .header svg {
          width: 80vw;
          max-height: 20vh;
        }
      }

      @media (max-aspect-ratio: 1/1) and (max-height: 240px) {
        .header img,
        .header svg {
          margin-bottom: -10px;
        }
      }

      #final_img {
        background: none;
      }

      .wheelShadow {
        filter: drop-shadow(3px 5px 15px #000);
      }

      @media (min-aspect-ratio: 1/1) {
        .wheelShadow {
          height: 90vh;
          max-width: 50vw;
        }
      }

      @media (max-aspect-ratio: 1/1) {
        .wheelShadow {
          width: 90vw;
          max-height: 50vh;
        }
      }

      @media (max-aspect-ratio: 1/1) {
        #wheel {
          order: 2;
        }
      }

      .buttonsVert {
        display: none;
      }

      @media (max-aspect-ratio: 1/1) {
        .buttonsVert {
          display: flex;
        }
      }

      .buttonsHor {
        display: none;
      }

      @media (min-aspect-ratio: 1/1) {
        .buttonsHor {
          display: flex;
        }
      }

      #win {
        width: 0px;
        height: 0px;
        position: relative;
        z-index: 3;
        opacity: 1;
        transition: opacity 500ms;
      }

      #fin {
        width: 0px;
        height: 0px;
        position: relative;
        z-index: 3;
        opacity: 1;
        transition: opacity 500ms;
      }

      #fin svg {
        max-width: 100vw;
        max-height: 100vh;
        opacity: 1;
        transition: opacity 500ms;
      }

      .fin_inner {
        width: 100vw;
        height: 100vh;
        overflow: hidden;
        display: flex;
        justify-content: center;
        align-items: center;
      }

      .win_inner {
        width: 100vw;
        height: 100vh;
        overflow: hidden;
        display: flex;
        justify-content: center;
        align-items: center;
        background: rgba(0, 0, 0, 0.5333333333);
        backdrop-filter: blur(2px);
        align-content: center;
        flex-wrap: wrap;
      }

      .win_inner svg {
        max-width: 100vw;
        max-height: 100vh;
        opacity: 1;
        transition: opacity 500ms;
      }

      .win_inner #win_inner_img {
        animation: win_inner_anim 1s alternate infinite ease-in-out;
      }

      @keyframes win_inner_anim {
        0% {
          transform: scale(1);
        }

        100% {
          transform: scale(1.2);
        }
      }

      .dnone {
        display: none !important;
      }

      .onone {
        opacity: 0 !important;
      }

      #wheel:hover {
        cursor: pointer;
      }

      #spinner {
        transform: rotate(135deg);
        transform-origin: center;
      }

      .spin {
        animation: spin_animation_1 2s ease-in forwards,
          spin_animation_2 2s 2s linear forwards,
          spin_animation_3 5s 4s cubic-bezier(0.12, 0.58, 0.34, 1.17) forwards,
          spin_animation_4 1s 9s cubic-bezier(0.26, 0.64, 0.63, 1.2) forwards;
      }

      @keyframes spin_animation_1 {
        0% {
          transform: rotate(135deg);
        }

        100% {
          transform: rotate(855deg);
        }
      }

      @keyframes spin_animation_2 {
        0% {
          transform: rotate(855deg);
        }

        100% {
          transform: rotate(1935deg);
        }
      }

      @keyframes spin_animation_3 {
        0% {
          transform: rotate(1935deg);
        }

        100% {
          transform: rotate(2532deg);
        }
      }

      @keyframes spin_animation_4 {
        0% {
          transform: rotate(2532deg);
        }

        100% {
          transform: rotate(2520deg);
        }
      }

      #selector {
        transform-origin: top;
      }

      .selector_spin {
        animation: selector_spin_animation_1 0.3s 0.25s ease-out forwards,
          selector_spin_animation_1 0.28s 0.5s ease-out forwards,
          selector_spin_animation_1 0.26s 0.66s ease-out forwards,
          selector_spin_animation_1 0.25s 0.805s ease-out forwards,
          selector_spin_animation_1 0.24s 0.925s ease-out forwards,
          selector_spin_animation_1 0.23s 1.05s ease-out forwards,
          selector_spin_animation_1 0.22s 1.15s ease-out forwards,
          selector_spin_animation_1 0.21s 1.26s ease-out forwards,
          selector_spin_animation_1 0.2s 1.36s ease-out forwards,
          selector_spin_animation_1 0.2s 1.46s ease-out forwards,
          selector_spin_animation_1 0.2s 1.54s ease-out forwards,
          selector_spin_animation_1 0.2s 1.63s ease-out forwards,
          selector_spin_animation_1 0.2s 1.72s ease-out forwards,
          selector_spin_animation_1 0.2s 1.79s ease-out forwards,
          selector_spin_animation_1 0.2s 1.88s ease-out forwards,
          selector_spin_animation_1 0.2s 1.95s ease-out forwards,
          selector_spin_animation_1 0.0832s 24 1.995s ease-out forwards,
          selector_spin_animation_1 0.2s 3.998s ease-out forwards,
          selector_spin_animation_1 0.2s 4.115s ease-out forwards,
          selector_spin_animation_1 0.2s 4.205s ease-out forwards,
          selector_spin_animation_1 0.21s 4.31s ease-out forwards,
          selector_spin_animation_1 0.21s 4.42s ease-out forwards,
          selector_spin_animation_1 0.21s 4.54s ease-out forwards,
          selector_spin_animation_1 0.21s 4.67s ease-out forwards,
          selector_spin_animation_1 0.21s 4.83s ease-out forwards,
          selector_spin_animation_1 0.24s 5.02s ease-out forwards,
          selector_spin_animation_1 0.28s 5.24s ease-out forwards,
          selector_spin_animation_1 0.35s 5.48s ease-out forwards,
          selector_spin_animation_1 0.5s 5.85s ease-out forwards,
          selector_spin_animation_1 0.8s 6.3s ease-out forwards,
          selector_spin_animation_2 1.8s 7.1s ease-in-out forwards;
      }

      @keyframes selector_spin_animation_1 {
        0% {
          transform: rotate(0deg);
        }

        10% {
          transform: rotate(-20deg);
        }

        100% {
          transform: rotate(0deg);
        }
      }

      @keyframes selector_spin_animation_2 {
        0% {
          transform: rotate(0deg);
        }

        50% {
          transform: rotate(-20deg);
        }

        100% {
          transform: rotate(0deg);
        }
      }
    </style>
  </head>
